            "title": "HELLOWEEN - I Want Out (Official Music Video)",
            "description": "ATTENTION!\n\n»United Alive« & »United Alive In Madrid« – The video- & audio-releases\nWith the releases of »UNITED ALIVE« & »UNITED ALIVE IN MADRID« on Nuclear Blast, the band presents stunning audio and visuals of the epic tour. Every single solo, every spontaneous gesture, and every emotional encore of the PUMPKINS UNITED WORLD TOUR is evoked and made immortal. Band interviews and plenty of background material included. The artworks for the various formats were once again created by photographer and art designer Martin Hausler, who of course stuffed lots of previously unreleased live images into the 36-page booklet and high-end\u200b packaging.\n \n»United Alive« – DVD/Blu-Ray\nThe DVD/BLU-RAY »UNITED ALIVE« captures the phenomenal sets with recordings from Wacken in front of 75,000 metal heads , 14,000 fans in the Madrid arena, and topped off by the legendary gig at the Espaço das Américas in front of 8,000 fans in São Paulo. In total, there's over three hours of live material in stereo and premium 5.1 surround sound plus a movie compilation with the essentials of the concert’s LED content, all cartoon clips of Seth and Doc, further surprises, and the very personal 30-minute band interview about the past, present, and future.\n\n»United Alive« & »United Alive In Madrid« will be available in the following formats, and can be pre-ordered here: https://bit.ly/2GGIPzR\n\nFollow us online: \nwww.helloween.org\nwww.facebook.com/helloweenofficial/\nwww.instagram.com/helloweenofficial\nwww.nuclearblast.de/helloween\n\nComposer: Kai Hansen - Publisher: Maldoror/Wintrup Music\n\nUpload by: David / helloween.org",
