            "title": "HELLOWEEN - Out For The Glory (Official Music Video)",
            "description": "Released in June 2021, “HELLOWEEN“ is THE Metal-Album of 2021 – a milestone fans were waiting decades for. Critics and companions are united in their crystal clear opinion that this is a masterpiece album that will write metal history. \n\n#helloween #outfortheglory #musicvideo #weikath #rmit #melbourne #university \n\nThe 7 piece metal alliance scored worldwide ten Top 10 chart entries including #1 in Germany and Spain, Top 3 in Austria and Switzerland and impressive total of seventeen Top 15 rankings all over the world. Fans, journalists and experts agreed: with 12 tracks “HELLOWEEN“ manifested an entire Metal-Universe.\n\nNo reason to sit back: with the clip for “OUT FOR THE GLORY“ the next exciting coup is coming as the successful year is ending. \"I had an idea for a video where all band members are depicted as dinky, odd noble courtiers and ministers\" Michael Weikath explains. \"All of us should be floating in the clouds, Deris as a nutty emperor…and after a while more and more details came up and at one point in time we wrote everything down and sent the video concept to the Australian animation team\". \n\nAaron McLoughlin, Senior Lecturer at RMIT University in Melbourne, who has already been involved in several projects with Atomic Fire Records CEO Florian Milz (e.g. for Children Of Bodom, Alestorm, Tankard) mentioned: \"When I heard that HELLOWEEN is interested in a collaboration I was totally gobsmacked. The boys are my absolute heroes since I was a teenager and I was sure that my students would love to work on a song by this band.\" \n\nAnd typically HELLOWEEN  - the creativity was so outrageous that it was impossible to feature everything in one music video. \"Seven and a half minutes might not sound like a lot but in animation terms it is a marathon. We had so much great stuff that the production of “OUT FOR THE GLORY“ was a real challenge. Weiki wanted the video to look as cute as possible and we immediately knew: A legendary band from the other side of the planet wants us to create a medieval epic full of cuteness? You bet!\" McLoughlin recollects. \n\nWith a bit over 10.000 frames the iconic animation short movie is not only extremely elaborate, but also wicked and spacy, will cause a commotion and hopefully also a lot of fun and enjoyment. As Michael Weikath wishes with a twinkle in his eye: \"I now expect that everyone will enjoy this and think it is funny and also that they see the signification!\"\n\nCreated by students in the Bachelor of Design (Animation & Interactive Media) program at RMIT University in Melbourne, Australia.\n\nVideo script co-authored by Kati Rausch (www.instagram.com/katirauschofficial) \n\nDirected by: Melanie Avent & Lee Henry\n\nProduced by: Melanie Avent, Juan Chacon-Olier, Aaron McLoughlin, Amy Wang\n\nAnimators: Melanie Avent, Yunlin Bai, Anastasia Beth, Rali Beynon, Noah Cail, Xinyu Chen, Wendy Cui, Cross Ferrer, Dannielle Gilbert, Lee Henry, Nicole Huang, Carmen Kusumo, Xueqi Li, Jacynth Lim, Robert Luu, Rongrong Mai, Huey Jing Ng, Hoang Gia Nguyen, Gabrielle Poh, Herschel Rego, Courtney Spencer, Kate Tandoc, Vy Trinh, Hoai Diem Suong Truong, Amy Wang, Ari Xu, Haowen Xue, Joy Zou\n\nUNITED FORCES 2022 European Tour with HammerFall - buy tickets:\nhttps://bit.ly/2E1KcHE\n\nOrder the new album \"Helloween\":\nhttps://shop.atomicfire-records.com/products?fulltext=helloween\n\nBuy official HELLOWEEN merchandise:\nhttps://www.pumpkins-store.com/\n\nUNITED ALIVE world tour highlights: \nhttps://youtu.be/DeyGPOV0kPc\u200b\n\nWatch all of HELLOWEEN's music videos: \nhttps://www.youtube.com/watch?v=P95N5...\n\nLike us on Facebook:\nhttps://www.facebook.com/helloweenoff...\n\nSubscribe to our Instagram: \nhttps://www.instagram.com/helloweenof...\n\nFollow us on Twitter:\nhttps://twitter.com/helloweenorg\u200b \n\nCheck out our website:\nhttps://www.helloween.org\u200b",
