              "title": "HELLOWEEN - Invitation / Eagle Fly Free (Live in Madrid, 2017, United Alive)",
              "description": "Together we'll fly someday! Watch German Heavy Metal legends HELLOWEEN perform their \"Keeper Of The Seven Keys Part II\" classic \"Eagle Fly Free\" in their \"Pumpkins United\" line-up featuring Michael Kiske and Kai Hansen live in Madrid, Spain, during their \"United Alive\" world tour 2017/18. \n\n#Helloween #EagleFlyFree #Live #UnitedAlive #UnitedAliveTour  #PumpkinsUnited #Metal #GermanMetal #Hansen #Weikath #Großkopf #Kiske #Deris #Gerstner #Löble #Pumpkins #Spain #Madrid \n\nThe UNITED FORCES tour 2022/23 is kicking off in Europe in May - don't miss out and get your tickets now! https://bit.ly/2E1KcHE \n \nWith the releases of »UNITED ALIVE« & »UNITED ALIVE IN MADRID« on Nuclear Blast, the band presents stunning audio and visuals of the epic tour. Every single solo, every spontaneous gesture, and every emotional encore of the PUMPKINS UNITED WORLD TOUR is evoked and made immortal. Band interviews and plenty of background material included. The artworks for the various formats were once again created by photographer and art designer Martin Häusler, who of course stuffed lots of previously unreleased live images into the 36-page booklet and high-end\u200b packaging.\n\n»United Alive« – DVD/Blu-Ray\nThe DVD/BLU-RAY »UNITED ALIVE« captures the phenomenal sets with recordings from Wacken in front of 75,000 metal heads , 14,000 fans in the Madrid arena, and topped off by the legendary gig at the Espaço das Américas in front of 8,000 fans in São Paulo. In total, there's over three hours of live material in stereo and premium 5.1 surround sound plus a movie compilation with the essentials of the concert’s LED content, all cartoon clips of Seth and Doc, further surprises, and the very personal 30-minute band interview about the past, present, and future.\n\n»United Alive« & »United Alive In Madrid« are available in the following formats, and can be ordered here: https://bit.ly/2GGIPzR\n\nUNITED ALIVE world tour highlights: \nhttps://www.youtube.com/watch?v=DeyGPOV0kPc&&list=PLjSI8RIYQ1T7InSkr1c3gxvO-L6VhOtFl\n\nWatch all of HELLOWEEN's music videos: \nhttps://www.youtube.com/watch?v=yh8zPuB03_c&&list=PLjSI8RIYQ1T4WbKfrusZmG4WKBWKTvX10\n\nLike us on Facebook:\nhttps://www.facebook.com/helloweenofficial\n\nSubscribe to our Instagram: \nhttps://www.instagram.com/helloweenofficial\n\nFollow us on Twitter:\nhttps://twitter.com/helloweenorg \n\nCheck out our website:\nhttps://www.helloween.org"
