            "description": "The pre-released single \"SKYFALL\" from the acclaimed and self-titled album \"HELLOWEEN\" is a 12 minute epos written by Kai Hansen and has the long yearned “Keeper-vibe”. \"SKYFALL\" implies the musical arch which will be loved by fans of every era. This first album of a new age is taking the fans from unforgettable memories of the fifteen studio records and four live CD’s to new adventures. \"SKYFALL\" begins with a bang. The epic track describes an alien landing on earth and a dramatic chase while Michael Kiske, Andi Deris and Kai Hansen duel with each other in a breathtaking manner and create a vocal broadband adventure. (Music and lyrics: Kai Hansen) \n\n#Helloween #Skyfall #AlbumVersion #LyricVideo #Hansen #Deris #Kiske #HeavyMetal \n\nBuy the new album \"Helloween\":\nhttps://shop.atomicfire-records.com/products?fulltext=helloween\n\nUNITED ALIVE world tour highlights: \nhttps://youtu.be/DeyGPOV0kPc\u200b\n\nWatch all of HELLOWEEN's music videos: \nhttps://www.youtube.com/watch?v=P95N5...\n\nLike us on Facebook:\nhttps://www.facebook.com/helloweenoff...\n\nSubscribe to our Instagram: \nhttps://www.instagram.com/helloweenof...\n\nFollow us on Twitter:\nhttps://twitter.com/helloweenorg\u200b \n\nCheck out our website:\nhttps://www.helloween.org\u200b",
